import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';


function News() {

    const news = useSelector(state => state.news.news[0] === undefined ? [] : state.news.news);
    console.log(news)

    return (
        <div className="child container">
            {news.map(news => (

                <a hey={news.title[news]} className="child home_card" href="#!">
                    <article>
                        <h1>{news.title[news]}</h1>
                        <p>l{news.description}</p>
                    </article>
                </a>
            ))}
        </div>
    )
}

export default News;
